import React from 'react';
import {
  Link,
  UnorderedList,
  ListItem,
  majorScale,
  IconButton,
} from 'evergreen-ui';
import { className, styles } from './styles.js';

export const HeaderMenu = () => {
  return (
    <>
      <IconButton
        appearance="minimal"
        className={`filters__close-button-mobile ${className}`}
        icon="cross"
      />
      <UnorderedList
        className={`header__menu ${className}`}
        display="flex"
        alignItems="center"
        marginRight={majorScale(2)}
      >
        <ListItem>
          <Link href="https://thesustainablelist.typeform.com/to/PnaHPh">
            <strong>Add a brand</strong>
          </Link>
        </ListItem>
        <ListItem>
          <Link href="/about">About</Link>
        </ListItem>
        <ListItem>
          <Link href="/contact">Contact Us</Link>
        </ListItem>
      </UnorderedList>
      {styles}
    </>
  );
};
